import React from 'react';

import {
  Container,
  Title,
  Wrapper,
  CardContainer,
  CardIcon,
  CardTitle,
  CardDescription,
} from './styles';

const SessionTwo = (): JSX.Element => {
  return (
    <Container>
      <Title>How to find your professional toSupply</Title>
      <Wrapper>
        <CardContainer>
          <CardIcon />
          <CardTitle />
          <CardDescription />
        </CardContainer>
      </Wrapper>
    </Container>
  );
};

export default SessionTwo;
